import * as React from 'react';
import styled, { css } from 'styled-components';
import TeamCard from './team-card';

const ButtonCommon = styled.button`
  background-color: #ed453b;
  height: 40px;
  border: unset;
  border-radius: 20px;
  color: white;
  font-size: 16px;
  cursor: pointer;
  
  &:disabled {
    background-color: #ccc;
    cursor: not-allowed;
  }
`;

const RedoButton = styled(ButtonCommon)`
  background-color: #16a34a;
  width: 100%;
  margin-top: 10px;
  display: flex;
  align-items: center;
  justify-content: center;
  gap: 10px;
  
  img {
    width: 20px;
    height: 20px;
    filter: brightness(0) invert(1);
  }
`;

const ControlsContainer = styled.div`
  display: flex;
  flex-direction: column;
  gap: 10px;
  border-radius: 10px;
  width: 350px;
  height: 100%;
`;

const AddTeamContainer = styled.div`
  display: flex;
  gap: 10px;
`;

const Title = styled.div`
  color: white;
  font-size: 20px;
`;

const AddTeamInput = styled.input`
  height: 40px;
  border-radius: 20px;
  width: 80%;
  border: unset;
  outline: unset;
  padding-left: 10px;
`;

const AddTeamButton = styled(ButtonCommon)`
  width: 40px;
  font-size: 24px;

  ${({ isDisabled }) =>
    isDisabled &&
    css`
      pointer-events: none;
      background-color: #7c7c7c;
    `}
`;

const StartGameButton = styled(ButtonCommon)`
  ${({ isDisabled }) =>
    isDisabled &&
    css`
      pointer-events: none;
      background-color: #7c7c7c;
    `}
`;

const TeamsList = styled.div`
  display: flex;
  flex-direction: column;
  gap: 10px;
`;

const GameStatusContainer = styled.div`
  margin-top: auto;
`;

const GameControls = ({
  onTeamAdded,
  onTeamClick,
  onGameStart,
  onTurnComplete,
  gameState,
  teams,
  activeTeam,
  currentTurn,
  roundNumber,
  onRedo,
  canRedo,
  pendingCaptureZone,
  captureState,
}) => {
  const [teamNameInput, setTeamNameInput] = React.useState('');

  // Helper to check if a team is attacking or defending
  const getTeamStatus = (teamIndex) => {
    if (!pendingCaptureZone) return null;

    // Check if team is attacking (active team)
    if (teamIndex === activeTeam) return 'attacking';

    // Check if team is defending (owns the zone)
    const isDefending = teams[teamIndex].zones.includes(pendingCaptureZone);
    if (isDefending) return 'defending';

    return null;
  };

  return (
    <ControlsContainer>
      {gameState === 'prepare' && (
        <>
          <AddTeamContainer>
            <AddTeamInput
              name="teamNameInput"
              value={teamNameInput}
              placeholder="Имя комманды"
              onChange={(e) => setTeamNameInput(e.target.value)}
            />
            <AddTeamButton
              onClick={() => {
                if (!teamNameInput) return;
                onTeamAdded(teamNameInput);
                setTeamNameInput('');
              }}
              isDisabled={teams.length > 6 || !teamNameInput}
            >
              +
            </AddTeamButton>
          </AddTeamContainer>
          <StartGameButton onClick={onGameStart} isDisabled={teams.length < 2}>
            Начать игру
          </StartGameButton>
        </>
      )}
      <TeamsList>
        {teams.map((team, index) => (
          <TeamCard
            key={team.name}
            team={team}
            onTeamClick={() => onTeamClick(index)}
            isMyTurn={index === activeTeam}
            gameState={gameState}
            status={getTeamStatus(index)}
          />
        ))}
      </TeamsList>
      {gameState !== 'prepare' && (
        <GameStatusContainer>
          <Title>Раунд: {roundNumber}</Title>
          <Title>Ход команды: {teams[activeTeam].name}</Title>
          <ButtonCommon onClick={() => onTurnComplete()} style={{ width: '100%', marginTop: '10px' }}>
            TMP NEXT TURN
          </ButtonCommon>
          <RedoButton onClick={onRedo} disabled={!canRedo}>
            <img src="/images/redo-icon.png" alt="" />
            Повторить
          </RedoButton>
        </GameStatusContainer>
      )}
    </ControlsContainer>
  );
};

export default GameControls;
